import React from'react'
import epilovers from './epilovers.png'

class Top extends React.Component   {
    constructor()   {
        super()
        this.state=({
            changed: true,
        })
    }
    changeVariable()    {
        this.setState =({
            changed: false ,
        })
        console.log(this.state.changed)
    }
    render(){
        return(
            <div>
            <div className ="toolsBar">
                <div className ="topContainer">
                    <img src ={epilovers} width ="10%" float="right"></img>
                    <a href ="#">ACTUALITES</a>
                    <a href ="#">GUIDE</a>
                    <a href ="#">TELECHARGEMENT</a>
                    <a href ="#">INFORMATIONS</a>
                    <a href ="#">A PROPOS</a>
                    <button className ="bouttonResponsif" onClick ={() =>this.changeVariable()}></button>
                </div>
            </div>
            <div className="menuResponsif">
                <a href ="#">ACTUALITES</a>
                <a href ="#">GUIDE</a>
                <a href ="#">TELECHARGEMENT</a>
                <a href ="#">INFORMATIONS</a>
                <a href ="#">A PROPOS</a>
            </div>    
            </div>        
                    
            
        )
    }
}
export default Top;
